n    t = time.time()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.time() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"below":[{"id":"1048"}],"center":[{"id":"1051"},{"id":"1055"}],"left":[{"id":"1052"}],"renderers":[{"id":"1070"}],"sizing_mode":"stretch_both","title":{"id":"1417"},"toolbar":{"id":"1061"},"x_range":{"id":"1040"},"x_scale":{"id":"1044"},"y_range":{"id":"1042"},"y_scale":{"id":"1046"}},"id":"1039","subtype":"Figure","type":"Plot"},{"attributes":{},"id":"1040","type":"DataRange1d"},{"attributes":{"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"num_fds"}},"id":"1394","type":"Line"},{"attributes":{},"id":"1484","type":"DatetimeTickFormatter"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"callback":null},"id":"1056","type":"TapTool"},{"attributes":{},"id":"1485","type":"AllLabels"},{"attributes":{"start":0},"id":"1286","type":"DataRange1d"},{"attributes":{"base":1024,"mantissas":[1,2,4,8,16,32,64,128,256,512]},"id":"1209","type":"AdaptiveTicker"},{"attributes":{"mantissas":[1,2,5],"max_interval":500.0,"num_minor_ticks":0},"id":"1512","type":"AdaptiveTicker"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{},"id":"10
